  `recipe_id` bigint NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `core_recipeingredient_recipe_id_ingredient_id` (`recipe_id`,`ingredient_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


